  const getLogout = useContext(ContextAUTH);
  const navigate = useNavigate()
  console.log(getLogout);
  return (
    <nav>
        <ul>
            <li><NavLink to={"/"} style={{"color":
                ({ isActive, isPending }) =>isActive ? "active" : ""
            }}
            >Home</NavLink></li>
            <li><NavLink to={"/login"}>Profile</NavLink></li>
            {
                getLogout.data.isLogged === null ? 
                <li onClick={()=>{
                    navigate('/')
                }}>Connexion</li>
                :
                <li onClick={()=>{
                    getLogout.logoutHandler()
                    navigate('/')
                }}>DÃ©connexion</li>
            }
        </ul>
    </nav>
  )
}

export default NavBar
